INSERT INTO `page_lang` (`PageID`, `PageKodu`, `LangID`, `PageBaslik`, `PageIcerik`, `Title`, `Keywords`, `Description`) VALUES
(1, 'P1651', 12, 'AGB', '<p>#</p>', 'AGB', 'AGB', 'AGB'),
(9, 'P9219', 12, 'Datenschutzrichtlinie und Cookies', '<p>AGB</p><p><br></p><p><br></p><p>Allgemeine Geschäftsbedingungen</p><p>Der Schutz Ihrer personenbezogenen Daten bei der Erhebung, Verarbeitung</p><p>und Nutzung anlässlich Ihres Besuchs auf unserer Homepage ist uns ein</p><p>wichtiges Anliegen. Ihre Daten werden im Rahmen der gesetzlichen</p><p>Vorschriften geschützt.</p><p><br></p><p>Diese Allgemeinen Geschäftsbedingungen der Axenda Umzug &amp; Transport</p><p>GmbH- nachfolgend “AGB” genannt – Regeln den Kauf von Produkten und den</p><p>Erwerb von Dienstleistungen von der Axenda Umzug &amp; Transport GmbH. Diese</p><p>AGB und die Vertragsdokumente stellen die vollständige Vereinbarung dar.</p><p>Sie ersetzen alle vorherigen mündlichen oder schriftlichen Absprachen</p><p>zwischen den Parteien.</p><p><br></p><p>Art.1 Geltungsbereich</p><p>Die Allgemeinen Geschäftsbedingungen (AGB) gelten für alle</p><p>Dienstleistungen der Axenda Umzug &amp; Transport GmbH.</p><p><br></p><p>Art.2 Pflichten der Axenda Umzug &amp; Transport GmbH</p><p>Axenda Umzug &amp; Transport ist verpflichtet, angenommene Aufträge</p><p>vertragsgemäss und mit notwendiger Sorgfalt auszuführen. Darüber hinaus</p><p>muss die Axenda Umzug &amp; Transport bei Unkorrektheit der Objektdaten den</p><p>Vertrag am Ausführungstag anpassen. Ansonsten besteht kein Anspruch auf</p><p>Vertragsanpassung.</p><p><br></p><p>Art.3 Pflichten des Kunden</p><p>Der Kunde ist verpflichtet, Angaben nach bestem Wissen und Gewissen zu</p><p>machen. Bei Abweichung zwischen dem auf dem Vertrag aufgeführten Angaben</p><p>und den am Vorort festgestellten Daten kann Axenda Umzug &amp; Transport</p><p>einen angemessenen Zuschlag verlangen.</p><p><br></p><p>Art.4 Preise</p><p>Unsere Preise berechnen sich entweder nach Aufwand (Mindestaufwand 3</p><p>Stunden) oder Pauschal/Kostendach. Die Preise verstehen sich exklusive</p><p>Mehrwertsteuer und in Schweizer Franken.</p><p><br></p><p>Vereinbarungen vorbehalten, folgende Aufwände:</p><p>1. das Ein- und Auspacken des Umzugsgutes, insbesondere für</p><p>Verpackungsarbeiten, die am Umzugstag durch Axenda Umzug &amp; Transport</p><p>GmbH vorgenommen werden müssen.</p><p>2. das Demontieren und Montieren von komplizierten oder neuen Möbeln,</p><p>die besondere Zeitaufwand oder den Beizug eines Schreiners benötigen.</p><p>3. der Transport von Kühlschranken/Truhen von über 200 kg, Klavieren und</p><p>anderen Gegenstände von mehr als 100 kg Eigengewicht</p><p>4. das Abnehmen und Anbringen von Bildern, Spiegeln, Uhren, Lampen,</p><p>Vorhängen, Einbauten usw.</p><p>5. der Mehraufwand für Gegenstände, deren Transport durch Fenster oder</p><p>über Balkone zu erfolgen hat</p><p>6. Zollabfertigung, Zoll und Zollspesen</p><p><br></p><p>Der Aufwand hängt von verschiedenen Faktoren ab: Witterungsverhältnisse</p><p>,Grösse und Möblierung der Wohnung, Eigenleistungen, Distanz vom alten</p><p>zum neuen Wohnort bzw. von der Strasse zum Haus, Stockwerk, Art des</p><p>Treppenhauses, Lift usw. Diese Richtpreistabelle haben wir aufgrund</p><p>unserer langjährigen Erfahrung für Sie zusammengestellt. Je nach</p><p>individueller Situation kann sie wesentlich über- oder unterschritten</p><p>werden.</p><p><br></p><p>&nbsp; Art.5 Bezahlung</p><p>Die vereinbarte Vergütung ist nach Beendigung der Arbeit dem</p><p>Umzugsleiter in Bar zu bezahlen, sofern nicht schriftlich eine anders</p><p>lautende Zahlungsvereinbarung getroffen wurde.Die Bezahlung für die</p><p>Reinigung erfolgt immer Bar am Tag der Übergabe.</p><p><br></p><p>Bei Rechnung ist der Gesamtbetrag innerhalb von 5 Tagen ohne Abzug zu</p><p>begleichen. Bei Nichteinhaltung der angegebenen Frist von 5 Tagen,</p><p>werden dem Kunden zusätzliche Mahnkosten in Rechnung gestellt.</p><p><br></p><p>Art.6 Versicherung Umzug</p><p>Eine Transportversicherung über 100.000.- CHF (hunderttausend) pro Umzug</p><p>ist im Preis inbegriffen. Eine Betriebshaftpflichtversicherung über CHF</p><p>5‘000‘000 Mio. Versicherungssumme ist im Preis inbegriffen. Diese</p><p>Versicherung deckt Schaden an Drittpersonen.</p><p><br></p><p>&nbsp; Art.7 Rücktritt des Auftraggebers</p><p>Der &nbsp;Auftraggeber hat das Recht, eine in Ausführung begriffene</p><p>Dienstleistung umzudisponieren, gegen vollständige Abgeltung aller&nbsp;</p><p>dadurch verursachten Mehraufwendungen. Ein allfälliger Rücktritt des</p><p>Auftraggebers hat schriftlich zu erfolgen.</p><p><br></p><p>Bei Rücktritt innerhalb von 14 Kalendertagen vor dem geplanten Umzug&nbsp;</p><p>sind 30 %, bei einem Rücktritt innerhalb von 48 Stunden 80 % des in der</p><p>Offerte gestellten Betrages im Sinne eines pauschalierten</p><p>Schadenersatzes geschuldet. Beweist der &nbsp;Frachtführer einen grösseren</p><p>Schaden, ist auch dieser &nbsp;zu entschädigen.</p><p><br></p><p>&nbsp; Art.8 Haftung</p><p>Axenda Umzug &amp; Transport GmbH haftet nur für Schäden, die nachweislich</p><p>durch grobe Fahrlässigkeit seines Personals verursacht worden sind. Die</p><p>Axenda Umzug &amp; Transport GmbH haftet nur für Transportgut, dessen</p><p>Verpackung den normalen Transportanforderungen entspricht. So bedürfen</p><p>zerbrechliche Gegenstände wie Lampen, Pflanzen und technische Geräte</p><p>(Fernseher, Hi-Fi Geräte, PC’s) einer geeigneten Verpackung. Für</p><p>technische Geräte wird keine Haftung übernommen.</p><p><br></p><p>Bei Beschädigungen des Inhalts von Umzugskisten etc. haftet die Axenda</p><p>Umzug &amp; Transport GmbH nur, wenn deren Ein- und Auspacken durch seine</p><p>eigenen oder von ihm beauftragten Hilfspersonen besorgt worden sind. Die</p><p>Haftung der Axenda Umzug &amp; Transport GmbH beschränkt sich auf die Kosten</p><p>einer allfälligen Reparatur oder einer Entschädigung für Wertminderung,</p><p>unter Ausschluss jeglicher Ersatzansprüche.</p><p><br></p><p>Die Haftung der Axenda Umzug &amp; Transport GmbH beginnt mit der Abnahme</p><p>der Güter und endet mit dem Abladen am Bestimmungsort.</p><p><br></p><p>&nbsp; Art.9 Mängelrüge</p><p>Der Kunde ist verpflichtet, direkt nach dem Abladen am Bestimmungsort</p><p>das Frachtgut zu überprüfen. Reklamationen sind sofort dem Teamleiter</p><p>mitzuteilen und innert 3 Tagen der Axenda Umzug &amp; Transport GmbH</p><p>schriftlich mitzuteilen. Nach Ablauf dieser Frist können keinerlei</p><p>Reklamationen und Beanstandungen mehr berücksichtigt werden.</p><p><br></p><p>Art 10: Zügelshop und Onlinekauf.</p><p><br></p><p>Lieferung und Versandkosten</p><p>Wir liefern nur in die Schweiz zum Pauschalpreis von CHF 50.00. Abholung</p><p>ist ebenfalls möglich.</p><p>Preise und Zahlungskonditionen</p><p>Alle Produkte Preise und die Versandgebühren, sind in Schweizer Franken</p><p>(CHF) und inklusive Mehrwertsteuer.</p><p>Bankverbindung:</p><p>Twint: 076 453 86 23</p><p>&nbsp; &nbsp; &nbsp; &nbsp; Barzahlung</p><p>Rückgaberecht</p><p>Die Annulierung von Aufträgen mit mängelfreier Ware ist möglich und hat</p><p>sofort, spätestens aber 2 Tage nach Empfang der Ware zu erfolgen. Die</p><p>Rückgabe des Umzugmaterials auf Gefahr der Kundschaft.</p><p>Die Rückerstattung erfolgt spätenstens 48h nach Erhalt der Ware.</p><p><br></p><p>Rücksendung oder Übergabe an:</p><p><br></p><p>Unsere Kontodaten:</p><p><br></p><p>Axenda Umzug &amp; Transport GmbH</p><p>Dietlikerstrasse 41</p><p>CH-8302 Kloten</p><p><br></p><p>Tel: 079 904 45 22</p><p>Tel: 076 453 86 23</p><p><br></p><p>Bei einer Rücksendung melden Sie sich auf der E-Mail Adresse:</p><p>info@axendaumzug.ch um weitere Infos zu Ihrer Rücksendung zu erhalten.</p><p><br></p><p>Art.11 Lagerung</p><p>Die Lagerkosten sind moantlich zu bezahlen. Bei der Lagerung gibt es</p><p>keine Kündigungsfrist. Die Ware kann jederzeit ausgelagert, geliefert</p><p>oder abgeholt werden. Die Lagerware wird nicht herausgegeben bis alle</p><p>offenen Forderungen beglichen sind. Bei offenen Mietkosten wird maximal</p><p>2 Mal eine Erinnerung bzw. Mahnung verschickt. Die letzte Mahnung</p><p>erfolgt eingeschrieben per Post. Sollte bis dahin der offene Betrag</p><p>nicht überweisen werden, kann die Ware ohne Nachfrage entsorgt, verkauft</p><p>oder verwendet werden um die Unkosten auszugleichen bzw. zu minimieren.</p><p><br></p><p>Art.12 Versicherung Lagerung</p><p>Die Versicherung für Diebstahl, Elementarschaden ist gedeckt bis zu</p><p>einem Wert von 500.000.–</p><p><br></p><p>Art.13 Gerichtsstand und anwendbares Recht</p><p>Allfällige Streitigkeiten aus diesem Vertrag sind nach schweizerischem</p><p>Recht zu beurteilen. Dem zuständigen Gericht für die Beurteilung aller</p><p>zwischen beiden Vertragspartnern strittigen Ansprüche gilt der Hauptsitz</p><p>der Axenda Umzug &amp; Transport GmbH in 8302 Kloten ZH.</p>', 'Datenschutzrichtlinie und Cookies', 'Datenschutzrichtlinie und Cookies', 'Datenschutzrichtlinie und Cookies'),
(1, 'P1651', 13, 'About Us', '<p>Es Decoration continues its successful work by further strengthening its staff without compromising its understanding of quality products and services and makes great contributions to the Turkish Marine Industry.</p><p>The secret of our success lies in our passionate employees and strong project teams with a sense of entrepreneurial responsibility. We are all in the same boat - every employee is responsible for the future of ES DECORATION. For this reason, we always act professionally, do what we say and successfully complete our tasks. We are committed and enthusiastic to our customers, the company and our products.</p>', 'About Us', 'About Us', 'About Us'),
(9, 'P9219', 13, 'Privacy Policy and Cookies', '', '', '', ''),
(20, '205648', 15, 'Wie funktioniert es?', '<h4>Erhalten Sie kostenlos 5 Offerten. Schnell, sicher und transparent.</h4><p>Mit bestofferten.ch vergleichen Sie verschiedene <strong>Offerten&nbsp;</strong>von lokalen Firmen<strong>&nbsp;</strong>in ganzer Schweiz. Der einfache Weg zu Ihrem sorgenfreien Auftrag. Füllen Sie unser Anfrageformular in wenigen Minuten aus und Sie erhalten von uns innert weniger Stunden die passenden Offerten.</p><h4>So einfach funktioniert es:</h4><ul><li><strong>1. Anfrageformular ausfüllen</strong></li><li><strong>2. Offerten einholen</strong></li><li><strong>3. Offerten vergleichen</strong></li><li><strong>4. Firma auswählen</strong></li></ul><p>Das Portal funktioniert sehr einfach. Sie füllen das Formular einmal aus und Ihr Datensatz wird sofort an mehrere Umzugsfirmen in Ihrer Region in der Schweiz verschickt. Sie erhalten dann kostenlose Angebote von den einzelnen Firmen<strong>&nbsp;</strong>und entscheiden anschliessend, mit welcher Firma Sie umziehen möchten.</p><h3>Ihre Vorteile:</h3><h4>Zuverlässig</h4><p>Als Benutzer der besten Anfragen­vermittlungs­plattform der Schweiz profitieren Sie von den Erfahrungen tausender Kunden.</p><h4>Zeitsparend</h4><p>In 2 Minuten haben Sie das Formular ausgefüllt. Innert weniger Stunden haben Sie bereits erste Offerte.</p><h4>Kostensparend</h4><p>Der Preisvergleich lohnt sich. Holen Sie sich das perfekte Angebot für Ihre Bedürfnisse.</p><p>Wenn man an Umzug, Reinigung oder Malerarbeiten denkt, dann verbindet man das nur selten mit positiven Gefühlen. Wir möchten Ihnen mit unserem Portal etwas Last abnehmen, indem wir Ihnen das mühsame Suchen und vergleichen von Firmen vereinfachen. Bereits tausende von Interessenten haben Ihre Firma über unser <strong>P</strong><strong>ortal&nbsp;</strong>gefunden und waren völlig zufrieden damit.</p><p>Die Firmen können selbst bestimmen, in welcher Region sie ihre Dienste anbieten möchten. Unser System sucht aber anhand Ihres Wohnortes zuerst nach Firmen in der Schweiz, welche in Ihrer Nähe ihr Domizil haben. Da Ihr Auftrag eine sehr individuelle Angelegenheit ist, möchten die Firmen oftmals gerne im Voraus mit Ihnen einen kostenlosen und unverbindlichen Besichtigung vereinbaren. Deshalb macht es auch für die Firmen Sinn, dass der Auftragsort möglichst nahe bei der Firmendomizil liegt. Wenn keine Firmen mehr in Ihrer Nähe zur Verfügung stehen, dann sucht das System nach Firmen, welche ebenfalls an ihrem Wohnort Ihren Auftrag durchführen und wir vermitteln Ihren Kontakt ebenfalls solchen Firmen - bis die maximale Anzahl von fünf Firmen erreicht wurde.</p><p><br></p><p><br></p><footer><br></footer>', 'Wie funktioniert es?', 'Wie funktioniert es?', 'Wie funktioniert es?');
