(1, 1, '30 NOV - 03 DEC', 'New Collection', NULL, '50% Off / Selected items', 'Mus venenatis habitasse leo malesuada lacus commodo faucibus torquent donec', 'Über Unsere Unternehmung', '<p>Unsere Unternehmung mit der Produktionsstätte liegt in der Industrie-Zone von Adana – Türkei. Seit 1982 bearbeiten wir kaukasische Walnussbäume, die aus den östlichen Regionen der Türkei zu unser Werk angeliefert werden. Unser Werk, das mit neusten Technologiemaschinen ausgerüstet ist, vergrößert sich noch, um unsere großen und mittelgroßen Kunden sowie Kunsthandwerker auf der ganzen Welt zu bedienen.</p><hr><p>Jährlich verarbeiten wir über 3000 Tonnen Walnussbäume, woraus über 120`000 Schafthölzer in allen Modellen und Qualitäten resultieren. Jederzeit verfügen wir über 500 Tonnen Walnussstämme, die vor der Fabrikgelände bereitliegen…</p>', 'SHOP NOW', '#', 'NEU IM SHOP', 'BESTSELLER', 'EMPFEHLEN'),
(3, 11, '30 NOV - 03 DEC', 'New Collection', NULL, '50% Off / Selected items', 'Mus venenatis habitasse leo malesuada lacus commodo faucibus torquent donec', 'localhost_B6831.jpg', '<p>Unsere Unternehmung mit der Produktionsstätte liegt in der Industrie-Zone von Adana – Türkei. Seit 1982 bearbeiten wir kaukasische Walnussbäume, die aus den östlichen Regionen der Türkei zu unser Werk angeliefert werden. Unser Werk, das mit neusten Technologiemaschinen ausgerüstet ist, vergrößert sich noch, um unsere großen und mittelgroßen Kunden sowie Kunsthandwerker auf der ganzen Welt zu bedienen.</p><hr><p>Jährlich verarbeiten wir über 3000 Tonnen Walnussbäume, woraus über 120`000 Schafthölzer in allen Modellen und Qualitäten resultieren. Jederzeit verfügen wir über 500 Tonnen Walnussstämme, die vor der Fabrikgelände bereitliegen…</p>', 'SHOP NOW', '#', 'NEU IM SHOP', 'BESTSELLER', 'EMPFEHLEN'),
